import './driver.scss'
import React from 'react';

const Index: React.FunctionComponent = () => {
    return (
        <div className="driver">
            <img className="driver__picture" src="http://clipart-library.com/images/pi7rn8LdT.png" alt="driver"/>
            <div className="driver_details">
                <h3 className="driver_details__name">name placeholder</h3>
                <span className="driver_details__sub-detail">age: 20</span>
                <span className="driver_details__sub-detail">number: 20</span>
            </div>
            <div className="driver_actions">
                <button className="driver_actions__btn driver_actions__btn--select">Select</button>
                <button className="driver_actions__btn driver_actions__btn--remove">Remove</button>
            </div>

        </div>
    )
};

export default Index;
